angular.module('managerApp').filter('showByte', [function () {
  var oneEB = 1152921504606846976;
  var onePB = 1125899906842624;
  var oneTB = 1099511627776;
  var oneGB = 1073741824;
  var oneMB = 1048576;
  var oneKB = 1024;
  return function (bytes) {
    if (bytes >= oneEB) {
      return "".concat((bytes / oneEB).toFixed(2), "EB");
    }

    if (bytes >= onePB) {
      return "".concat((bytes / onePB).toFixed(2), "PB");
    }

    if (bytes >= oneTB) {
      return "".concat((bytes / oneTB).toFixed(2), "TB");
    }

    if (bytes >= oneGB) {
      return "".concat((bytes / oneGB).toFixed(2), "GB");
    }

    if (bytes >= oneMB) {
      return "".concat((bytes / oneMB).toFixed(2), "MB");
    }

    if (bytes >= oneKB) {
      return "".concat((bytes / oneKB).toFixed(2), "KB");
    }

    return "".concat(bytes, "B");
  };
}]);
